import React from 'react';
export default function Notifications({ items }) {
  return (
    <div>
      {items.length === 0 && <div>No notifications</div>}
      <ul style={{ listStyle:'none', padding:0 }}>
        {items.map((n,i)=> <li key={i} style={{ padding:10, borderBottom:'1px solid #eee' }}><div style={{ fontSize:13 }}>{n.text}</div><div style={{ fontSize:11, color:'#999' }}>{n.type}</div></li>)}
      </ul>
    </div>
  )
}
